import './App.css';
import {Fragment} from "react";

function App() {
  return (
    <Fragment>
      <h1>멋쟁이 사자처럼</h1>
      <p>중앙대학교</p>
      <span>최고</span>
    </Fragment>

  );
}

export default App;
